query Tx($contractAddress: String!, $tokenIdSet: [String!], $after: String) {
  nftTransfers(
    filters: {tokenIdSet: $tokenIdSet, contractAddress: $contractAddress}
    pagination: {sortKey: "blockNumber", sortDirection: Ascending, after: $after, limit: 1000}
  ) {
    contractAddress
    tokenId
    blockNumber
    txValueETH
    to
    _cursor
  }
}

